import React from "react";
import { Link } from "react-router-dom";

const userData = posts.map((user, key) => (
  <div>
    <Link
      key={key}
      className="dropdown-item"
      to={{ pathname: `/update-user/${user._id}` }}
    >
      <button className="text-center "> User </button>
    </Link>
  </div>
));

function UserData(posts) {
  return <div>{User}</div>;
}

export default UserData;
